import ListItem from 'ListItem';

function Content() {
    return (
      <div>  
       <ListItem name="Посмотреть урок по реакту"/>
       <ListItem name="Сделать домашку"/>
       <ListItem name="Позаниматься йогой"/>
       <ListItem name="Написать список покупок"/>
       </div>
    );
  }

  export default Content;
